import Quotations from './component/Quotations';
import QuotationPage from './component/QuotationPage';
import InsertPage from './component/InsertPage';
import "./App.css";

class App extends Component {

  render() {
    return (
      <div>
        <Tabs>
        <div label="Insert">
          <InsertPage />
        </div>
         <div label="Display">
           <QuotationPage />
         </div>
       </Tabs>
     </div>
    );
  }
}

export default App;
